                        Prison Life Magazine
                     , founded by a former drug pusher and an undercover DEA agent, advocates on behalf of prisoners convicted in the "War on Drugs"; and General Barry McCaffrey, President Clinton's drug "Czar," discussing his views on drug policy and the current state of the "War on Drugs".
